svg.script:
    function show_floor(floor) {
		var f1 = document.getElementById('F1');
		var f2 = document.getElementById('F2');

		if (floor == 1) {
			var active = f1;
			var inactive = f2;
		} else {
			var active = f2;
			var inactive = f1;
		}

		active.style.display = "inline";
		inactive.style.display = "none";
	}
	function activate_button(floor) {
		var f1button = document.getElementById('F1Button');
		var f2button = document.getElementById('F2Button');
		if (floor == 1) {
			var active_button = f1button;
			var inactive_button = f2button;
		} else {
			var active_button = f2button;
			var inactive_button = f1button;
		}

		active_button.setAttribute('class', "currentFloor floorButton");
		inactive_button.setAttribute('class', "floorButton");

		camera_floor(floor);
	}

	var camera = null;
	function camera_floor(floor) {
		if (camera == null) {
			camera = document.getElementById('Nav_Camera');
		}
		if (floor == 1) {
			camera.setAttribute('class', 'f1');
		} else {
			camera.setAttribute('class', 'f2');
		}
	}

	function click_floor(floor) {
		show_floor(floor);
		activate_button(floor);
	}
	function _click_f1(evt) {
		click_floor(1);
		if (evt) evt.stopPropagation();
		return false;
	}
	function _click_f2(evt) {
		click_floor(2);
		if (evt) evt.stopPropagation();
		return false;
	}

	var rooms = {
		'windover': 1,
		'portage_auditorium': 1,
		'charlevoix_a': 1,
		'charlevoix_b': 1,
		'charlevoix_c': 1,
		'algonquin_a': 1,
		'algonquin_bc': 1,
		'algonquin_d': 1,
		'tc_linguinis': 1,
		'board_directors': 2,
		'board_governors': 2,
		'montcalm': 2,
		'hamlin': 2,
		'baldwin_boardroom': 2,
		'board_trustees': 2,
		'board_regents': 2,
		'nicolet': 2
	};

	function get_room_list() {
		return Object.keys(rooms);
	}
	function select_room(room) {
		if (rooms.hasOwnProperty(room)) {
			click_floor(rooms[room]);
		}
		animate_room(room);
	}
	function select_random_room() {
		var list = get_room_list();
		var index = Math.floor(Math.random() * list.length);
		var room = list[index];
		select_room(room);
	}

	var highlightedRoom = null;

	function animate_room(room) {
		if (highlightedRoom) {
			highlightedRoom.setAttribute('class', '');
			highlightedRoom = null;	
		}
		if (rooms.hasOwnProperty(room)) {
			highlightedRoom = document.getElementById(room);
			highlightedRoom.setAttribute('class', 'highlightedRoom');
		}
	}
